const A="Microbiology Chapter 7 Homework",f="Homework questions for Microbiology Chapter 7.",P="Microbiology",v=[{id:"mc-ch7-hw-1",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 7",topic:"Microbial Metabolism",difficulty:"easy",question:"The arrows are pointing to the hydrophobic ends of this phospholipid bilayer.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. The arrows are pointing to the hydrophilic (water-loving) heads of the phospholipids, which face the aqueous environments inside and outside the cell. The hydrophobic (water-fearing) tails are in the interior of the membrane."},{id:"mc-ch7-hw-2",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 7",topic:"Microbial Metabolism",difficulty:"easy",question:"Carbohydrates are the source of all energy that we have available to us.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:0,explanation:"True. Carbohydrates, produced during photosynthesis, are the primary source of energy for most life on Earth. Cellular respiration breaks them down to release ATP."},{id:"mc-ch7-hw-3",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 7",topic:"Microbial Metabolism",difficulty:"easy",question:"All energy essentially came from plants.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. The ultimate source of energy for most life on Earth is the sun. Plants and other photosynthetic organisms capture this solar energy and convert it into chemical energy (glucose)."},{id:"mc-ch7-hw-4",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 7",topic:"Microbial Metabolism",difficulty:"easy",question:"This is sucrose, a polysaccharide.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Sucrose is a disaccharide, composed of two monosaccharide units: glucose and fructose. Polysaccharides are made of many monosaccharide units."},{id:"mc-ch7-hw-5",type:"multiple-choice",subject:"Microbiology",chapter:"Chapter 7",topic:"Microbial Metabolism",difficulty:"medium",question:"Lipids are larger than complex carbohydrates.",image:"data:image/jpeg;base64,",options:["True","False"],correctAnswer:1,explanation:"False. Complex carbohydrates, such as starch or cellulose, are polymers made of thousands of glucose units and are typically much larger macromolecules than individual lipid molecules like triglycerides or cholesterol."}],t={name:A,description:f,subject:P,questions:v};export{t as default,f as description,A as name,v as questions,P as subject};
